              e.preventDefault();
              this.props.onChangePage();
            }.bind(this)}><img className="Ask-for-Question"></img></a></div>
            <nav>
                <ul className="flex-ul">
                    <li className="flex-li">
                      <div>
                        <a href="1.html">나의 테스트</a>
                      </div>
